import { Route, Routes } from "react-router-dom";
import InicioAdmin from "../../../pages/Admin/InicioAdmin/InicioAdmin";
import "./ContentPageAdmin.css";

const ContentPageAdmin = () => {
    return (
        <div className="ContentPageAdmin">
            <Route path="/admin/inicio" element={<InicioAdmin/>}></Route>
        </div>
    );
}

export default ContentPageAdmin;
